Gravity Remixes is out today, a project close to my heart. 🌕

My talented friends, including April + VISTA, King Britt, Eduardo Castillo, Helios, East Forest, and Superposition, have taken the original tracks from Gravity and made the music their own. 🙏🏻

I shared the original layers of each piece - guitar, synth, and voice - allowing them to craft their own interpretations. After they completed their compositions and edits, they sent the stems back to me. I then meticulously assembled the immersive mixes in the Overlap studio and Envelop SF. 🔊

For the ultimate experience, listen with headphones or on multiple speakers with Atmos. 🎧 Link in my bio to listen. 

Gravity has been a source of immense joy for me, especially amidst the whirlwind of 2020-22. I'm endlessly thankful to my friends for infusing their unique talents and touching the music in such beautiful ways. ❤️

Big love to @ghostly for making this happen with us! 

