@aprilandvista remixed “Crescent,” their collaborative track with @willits, for his new Gravity Remixes project. The DC duo are currently touring with Little Dragon (with a collab EP out now).

For the remix, April is on violin, and VISTA is on guitar, piano, and production. They add: “It was so rewarding to step outside of what we normally do and tap into the serene. So much love to Chris for trusting us and we hope you all enjoy!”

